import React from 'react';
import  './Menu.css';
import { Link } from 'react-router-dom';

const Menu = () => {
    return(
        <div className="Menustyle">
            <ul>
                <li> <Link to="/"> HOME </Link> </li>
                <li> <Link to="/login"> lOGIN </Link> </li>
                <li> <Link to="/signup"> SIGN-UP </Link> </li>
                <li>ADD IDEA</li>
            </ul>
        </div>
    )
}

export default Menu;
